function dealers_page_js() {

    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_11': 'dealers_page_mobilebutton_11',
        'spacer_21': 'dealers_page_spacer_21',
        'mobileworkarea_18': 'dealers_page_mobileworkarea_18',
        'mobilelabel_22': 'dealers_page_mobilelabel_22',
        'mobiletextinput_23': 'dealers_page_mobiletextinput_23',
        'mobilebutton_24': 'dealers_page_mobilebutton_24',
        'mobileimage_3': 'dealers_page_mobileimage_3',
        'mobilelabel_20': 'dealers_page_mobilelabel_20',
        'Crops': 'dealers_page_Crops',
        'Insurance': 'dealers_page_Insurance',
        'Agrotips': 'dealers_page_Agrotips'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    /*
     * Nonvisual components
     */

    Apperyio.mappings = Apperyio.mappings || {};

    Apperyio.datasources = Apperyio.datasources || {};

    Apperyio.CurrentScreen = 'dealers_page';
    _.chain(Apperyio.mappings).filter(function(m) {
        return m.homeScreen === Apperyio.CurrentScreen;
    }).each(Apperyio.UIHandler.hideTemplateComponents);

    /*
     * Events and handlers
     */

    // On Load
    var dealers_page_onLoad = function() {
            dealers_page_elementsExtraJS();

            dealers_page_deviceEvents();
            dealers_page_windowEvents();
            dealers_page_elementsEvents();
        };

    // screen window events


    function dealers_page_windowEvents() {

        $('#dealers_page').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });

    };

    // device events


    function dealers_page_deviceEvents() {
        document.addEventListener("deviceready", function() {

        });
    };

    // screen elements extra js


    function dealers_page_elementsExtraJS() {
        // screen (dealers_page) extra code

    };

    // screen elements handler


    function dealers_page_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });

        $(document).off("click", '#dealers_page_mobileheader [name="mobilebutton_11"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    $('[id="dealers_page_panel_2"]').panel("open");

                }
            },
        }, '#dealers_page_mobileheader [name="mobilebutton_11"]');

        $(document).off("click", '#dealers_page_panel_2 [name="Crops"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('crops', {
                        transition: 'fade',
                        reverse: false
                    });

                }
            },
        }, '#dealers_page_panel_2 [name="Crops"]');
        $(document).off("click", '#dealers_page_panel_2 [name="Insurance"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Insurance', {
                        transition: 'pop',
                        reverse: false
                    });

                }
            },
        }, '#dealers_page_panel_2 [name="Insurance"]');
        $(document).off("click", '#dealers_page_panel_2 [name="Agrotips"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Agrotips', {
                        transition: 'fade',
                        reverse: false
                    });

                }
            },
        }, '#dealers_page_panel_2 [name="Agrotips"]');

    };

    $(document).off("pagebeforeshow", "#dealers_page").on("pagebeforeshow", "#dealers_page", function(event, ui) {
        Apperyio.CurrentScreen = "dealers_page";
        _.chain(Apperyio.mappings).filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        }).each(Apperyio.UIHandler.hideTemplateComponents);
    });

    dealers_page_onLoad();
};

$(document).off("pagecreate", "#dealers_page").on("pagecreate", "#dealers_page", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    dealers_page_js();
});